import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Nav from "./Nav";
import Footer from "./Footer";

import About from "./pages/About";
import Specials from "./pages/Specials";
import Order from "./pages/Order";
import Login from "./pages/Login";
import ReservationStepOne from './pages/ReservationStepOne';
import ReservationStepTwo from './pages/ReservationStepTwo';
import ReservationSuccess from './pages/ReservationSuccess';

function App() {
  return (
    <Router>
      <Nav />
      {/* Adjust paddingLeft if your nav width changes */}
      <Routes>
        <Route path="/about" element={<About />} />
        <Route path="/specials" element={<Specials />} />
        <Route path="/order" element={<Order />} />
        <Route path="/login" element={<Login />} />
        <Route path="/" element={<ReservationStepOne />} />
        <Route path="/step-two" element={<ReservationStepTwo />} />
        <Route path="/success" element={<ReservationSuccess />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
